import React, { useState } from "react";
import { list } from "./Api";
import { Hire } from "./NewResources";

export const Home=()=>{

    const[localArr,setlocalArr]=useState([])
    
const hai=()=>
{
    setlocalArr(list())
}
    
    return(

        <>
        <div className="container">
        <button onClick={hai}>View</button>
        </div>    
        <Hire/>   


         <div className="row justify-content-center">
                        <div className="table-responsive-md">
                            <table className="col-lg-8 col-md-10 col-sm-12 table table-striped p-3 shadow rounded">
                                <thead>
                                    <tr>
                                        <th> Name</th>
                                        <th> Id</th>
                                        
                                    </tr>
                                </thead>
                                <tbody>
                                    {localArr.map((elements)=>(
                                        <tr>
                                            <td>{elements.prodName}</td>
                                            <td>{elements.pro}</td>
                                            
                                        </tr>
                                    ))}
                                </tbody>
                            </table>
                        </div>
                    </div> 
        
        
        </>


    )


}
